import { LocationGrid } from "../common/Grid";

const Locations = ({ locations, type }) => {
  return (
    <div className="profile-characters">
      <LocationGrid
        locations={locations}
        xxl={4}
        sm={12}
        sx={12}
        md={8}
        xl={6}
        lg={8}
        gutter={[16, 16]}
        type={type}
      />
    </div>
  );
};

export default Locations;
